import React from 'react';
import {useState, useEffect } from "react";
import './style/app.css'

// `http://213.131.37.250:3001/users`


function App() {
  const [posts, setPosts] = useState([]);

  const fetchPosts = () => {
    fetch(`http://213.131.37.250:3001/users`).then(response => response.json()).then((json) => setPosts(json));
  }

  useEffect(() => {
fetchPosts();
  },[])


  return (
<div id='test'>
   {
    posts.map((post, index) => 
    <div key={index} id="post">
        <select>
          <option>{post.company}</option>
          <option>{post.person}</option>
          <option>{post.contact}</option>
          <option>{post.contact2}</option>
          <option>{post.mail}</option>
          <option>{post.mail2}</option>
        </select>
    </div>
    )
   }
</div>
  );
}

export default App;
